              type="text"
              placeholder="Attribute Value"
              id={props.assetTypeFieldId}
              value={props.assetTypeFieldValue}
              name={props.assetTypeFieldId}
              // onChange={props.handleChange}
              className="border"
            />
          </InputGroup>
          <div className="col col-2">
            <button className="delete-attribute">
              <FontAwesomeIcon className="" icon={faTrashAlt} />
            </button>
          </div>
        </div>
        <div className="row attribute-value">
          <div className="col col-5" />
          <div className="col col col-5">
            <span className="border p-0 pl-2 m-1 col col-2 attribute-values">
              dsadaasdasdasd <button className="delete-value">âœ•</button>
            </span>
          </div>
        </div>
        <div className="row">
          <button className="text-capitalize add-attribute ml-2">
            Add New Attribute
          </button>
        </div>

        <Button
          type="submit"
          className="btn onboarding-btn"
          disabled={props.disabled}
        >
          Submit
        </Button>
        {/* </form> */}
      </div>
    </div>
  );
};

